import { NavLink } from "react-router-dom";
import React from "react";

function NavBar(params) {
    return (
        <div>
            <NavLink
                to="/products"
                style={{background}}
                >
                Products   
            </NavLink>
            <NavLink
                to="/buyers"
                >
                Buyers   
            </NavLink>
            <NavLink
                to="/retailors"
                >
                Retailors  
            </NavLink>
        </div>
    )
}
export default NavBar;
